 export default function envialogin(item){
    const cargoUtil = JSON.stringify(item);
    alert(cargoUtil);
    fetch("http://localhost/IniciaSessio.php",{
        method:"POST",
        headers: {
            "Content-Type":'application/json'
        },
        body: cargoUtil
    }).then(res=>res
    ).then((res)=>console.log(res)).catch(e=>console.log(e));
}
